script: |
  super -f text -I q6136.spq | sort > q6136.out

inputs:
  - name: q6136.spq
    data: |
      SELECT + cor0.col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN ( col2 ) AND NULL OR NOT ( col0 ) BETWEEN ( - col0 * col1 - - col0 / col2 ) AND ( NULL );
  - name: tab1

outputs:
  - name: q6136.out
    data: |
